import React from "react";
import {Button, StyleSheet, Text, View} from "react-native";
import RegisterActor from "./RegisterActor";


export const Actor = ({id, name, lastName}) => {
    return (
        <View style={styles.actorStyle}>
            <Button
                title="RegisterActor"
                onPress={() => this.props.navigation.navigate('RegisterActor')}
            />
            <Text style={styles.id}>{id}</Text>
            <Text style={styles.name}>{name}</Text>
            <Text style={styles.name}>{lastName}</Text>

        </View>
    );


};

const styles = StyleSheet.create({
    actorStyle: {
        flex: 1,
        flexDirection: "row",
        paddingTop: 10,

    },

    id: {
        marginRight: 20,
        fontSize: 25,
    },
    name: {
        marginRight: 20,
        fontSize: 25,
        fontWeight: "bold",
    },

});
